$(document).ready(function(){$(".DeleteTimeframeButton").click(function(){var n="#Timeframe_"+$(this).data("id");$(n).remove()});$("#addTimeframe").click(function(n){n.preventDefault();var t=$(".timeframes").length,i=$("#Timeframes_0__EventDate").val(),r=`<div class="timeframes">
            <label for= "Timeframes_`+t+`__EventDate" > Event Date</label >
                <input min=`+i+` type="date" data-val="true" data-val-required="The Event Date field is required." id="Timeframes_`+t+`__EventDate" name="Timeframes[`+t+`].EventDate" value=`+i+` />
                <span class="field-validation-valid" data-valmsg-for="Timeframes[`+t+`].EventDate" data-valmsg-replace="true"></span>
                <label for="Timeframes_`+t+`__Starttime">Start</label>
                <input min="0" max="24" type="number" data-val="true" data-val-range="Invalid hour" data-val-range-max="24" data-val-range-min="0" data-val-required="The Start field is required." id="Timeframes_`+t+`__Starttime" name="Timeframes[`+t+`].Starttime" value="0" />
                <span class="field-validation-valid" data-valmsg-for="Timeframes[`+t+`].Starttime" data-valmsg-replace="true"></span>
                <label for="Timeframes_`+t+`__Endtime">End</label>
                <input min="0" max="24" type="number" data-val="true" data-val-range="Invalid hour" data-val-range-max="24" data-val-range-min="0" data-val-required="The End field is required." id="Timeframes_`+t+`__Endtime" name="Timeframes[`+t+`].Endtime" value="0" />
                <span class="field-validation-valid" data-valmsg-for="Timeframes[`+t+`].Endtime" data-valmsg-replace="true"></span>
            </div>`;$("#TimeframesToAdd").append(r)})});